import networkx as nx
import json
from geopy.distance import vincenty

def graph_generator(path):

    """Creates directed and undirected graphs of downtown Seattle.

    path [str]: path to nodes.geojson

    Returns an list of Networkx graph objects: undirected graph (index 0) and
    directed graph (index 1)."""



    # import node data from the geojson file taken from OSM
    with open(path) as f:
        data = json.load(f)

    nodes_dict = {}

    downtownSeattleGraph = nx.DiGraph()

    # read node data into directed graph 'downtownSeattleGraph'
    for i in range(len(data['features'])):
        lat = data['features'][i]['geometry']['coordinates'][1]
        lon = data['features'][i]['geometry']['coordinates'][0]
        geonode = float(data['features'][i]['id'].split('/')[1])
        try:
            crossing_type = data['features'][i]['properties']['crossing']
        except:
            crossing_type = None


        nodes_dict[geonode] = (lat, lon)
        downtownSeattleGraph.add_node(int(geonode), sensor=None, crossing_type=crossing_type, latitude=float(lat), longitude=float(lon))


    # function for reading edge data into 'downtownSeattleGraph'
    def into_dict(graph,edge_id, start, end, lanes, maxspeed, name, bicycle=None,
        cycleway=None, bus_lanes=None, access_lanes=None):
        distance = vincenty(nodes_dict.get(start), nodes_dict.get(end)).meters
        try:
            graph.add_edge(start, end, lanes=lanes,distance=distance,
            maxspeed=maxspeed,name=name,bicycle=bicycle,cycleway=cycleway,
            bus_lanes=bus_lanes,access_lanes=access_lanes)
        except:
            print('Node doesn\'t exist!')
            pass

